import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css'; // Assuming your CSS will be in this file

const Dashboard = () => {
  const navigate = useNavigate();

  // Retrieve user data from localStorage
  const userName = localStorage.getItem('userName');
  const userId = localStorage.getItem('userId');
  const userEmail = localStorage.getItem('userEmail');
  const userPhone = localStorage.getItem('userPhone');
  const userClubs = JSON.parse(localStorage.getItem('userClubs')) || [];
  const userEvents = JSON.parse(localStorage.getItem('userEvents')) || [];
  const userResources = JSON.parse(localStorage.getItem('userResources')) || [];

  // Handle button clicks to navigate to the appropriate page
  const handleViewClubs = () => {
    navigate('/clubs');
  };

  const handleViewEvents = () => {
    navigate('/events');
  };

  const handleViewResources = () => {
    navigate('/resources');
  };

  // Navigate to delete account page
  const handleDeleteAccount = () => {
    navigate('/delete-account');
  };

  // Navigate to logout page
  const handleLogout = () => {
    localStorage.clear(); // Clear localStorage when logging out
    navigate('/login'); // Redirect to login page
  };

  return (
    <div className="dashboard-container">
      {/* Profile Section */}
      <div className="profile-section">
        <div className="profile-info">
          <img
            className="profile-pic"
            src="https://www.w3schools.com/w3images/avatar2.png" // You can update this with the user's profile picture URL
            alt="User Avatar"
          />
          <div className="user-details">
            <h2 className="username">{userName}</h2>
            <p className="user-id"><strong>User ID:</strong> {userId}</p>
            <p className="user-email"><strong>Email:</strong> {userEmail}</p>
            <p className="user-phone"><strong>Phone:</strong> {userPhone}</p>
            <button className="btn btn-info">Edit Profile</button>
          </div>
        </div>
      </div>

      <h1 className="dashboard-title">Welcome to Your Dashboard</h1>

      {/* User's Clubs, Events, and Resources */}
      <div className="user-activities">
        <h3>Your Activities</h3>
        <div className="user-clubs">
          <h4>Clubs Joined:</h4>
          {userClubs.length > 0 ? (
            <ul>
              {userClubs.map((club, index) => <li key={index}>{club}</li>)}
            </ul>
          ) : (
            <p>No clubs joined yet.</p>
          )}
        </div>

        <div className="user-events">
          <h4>Events Joined:</h4>
          {userEvents.length > 0 ? (
            <ul>
              {userEvents.map((event, index) => <li key={index}>{event}</li>)}
            </ul>
          ) : (
            <p>No events joined yet.</p>
          )}
        </div>

        <div className="user-resources">
          <h4>Resources Shared:</h4>
          {userResources.length > 0 ? (
            <ul>
              {userResources.map((resource, index) => <li key={index}>{resource}</li>)}
            </ul>
          ) : (
            <p>No resources shared yet.</p>
          )}
        </div>
      </div>

      {/* Action Buttons */}
      <div className="button-group">
        <div className="card">
          <button className="btn btn-primary" onClick={handleViewClubs}>View All Clubs</button>
        </div>
        <div className="card">
          <button className="btn btn-secondary" onClick={handleViewEvents}>View All Events</button>
        </div>
        <div className="card">
          <button className="btn btn-success" onClick={handleViewResources}>View All Resources</button>
        </div>
      </div>

      {/* Actions Section */}
      <div className="action-group">
        <div className="card">
          <button className="btn btn-danger" onClick={handleDeleteAccount}>Delete Account</button>
        </div>
        <div className="card">
          <button className="btn btn-warning" onClick={handleLogout}>Logout</button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
